   "source": [
    "# Introduction - Bella Beat Case study \n",
    "\n",
    "Bellabeat is a high-tech manufacturer that developed wearable devices and accompanying products that monitor the health and lifestyle of women. The company is a very successful small company and has potential to become a key player in wearable technology. \n"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "34fac9fa",
   "metadata": {
    "papermill": {
     "duration": 0.061211,
     "end_time": "2022-02-09T00:50:10.510199",
     "exception": false,
     "start_time": "2022-02-09T00:50:10.448988",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "# Business Task \n",
    "\n",
    "\n",
    "Analyze existing competitor data to identify potential growth opportunities and recommendations on how consumers are using their smartwatch devices. The opportunities identified from the data will guide our marketing department to create a strategy based on one Bellabeat product. \n",
    "\n",
    "Question asked during analysis :\n",
    "\n",
    "1. What are the trends in smart device data?\n",
    "\n",
    "2. How could our team apply the trends to Bellabeat's existing and future consumers?\n",
    "\n",
    "3. How could the trends guide us in creating a new marketing strategy for Bellabeat?\n"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "c15112e0",
   "metadata": {
    "papermill": {
     "duration": 0.06462,
     "end_time": "2022-02-09T00:50:10.640203",
     "exception": false,
     "start_time": "2022-02-09T00:50:10.575583",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "## Bellabeat Products\n",
    "* Bellabeat app: The Bellabeat app provides users with health data related to their activity, sleep, stress, and reproductive cycle.\n",
    "* Leaf: Bellabeat's classic wellness tracker can be worn as jewellery (bracket, necklace or clip) and connects to the Bellabeat app to track activity, sleep and stress.\n",
    "* Time: The wellness watch combines a classic timepiece with smart technology to track activity, sleep and stress.\n",
    "* Spring: The product spring is a water bottle that tracks water intake using smart technology to ensure you are hydrated throughout the day. The spring bottle connects to the Bellabeat app to track hydration levels."
   ]
  },
