   "source": [
    "### FitBit Fitness Tracker Dataset\n",
    "\n",
    "(CC0: Public Domain, dataset made available through [Mobius](https://www.kaggle.com/arashnic/fitbit)\n",
    "): This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. There are 18 data sets that  contains personal fitness tracker from thirty fitbit users.  Thirty eligible Fitbit users consented to the submission of personal tracker data including minute-level output for phyical activity, heart rate, abnd sleep monitoring. \n",
    "\n",
    "For this case study, we will be using the datasets for daily activity, daily calories, daily steps, minuet METS, daily sleep and weight log information.The tool choosen for this analysis and data visulations is R Studio.\n",
    "\n"
   ]
  },
