   "source": [
    " Data Limitations \n",
    "1. Limitations for data exist due to the sample size and confidentiality of personal data. Key characteristics of participants were excluded from the data set, such as gender, age, height, location and lifestyle.\n",
    "\n",
    "\n",
    "2.  Participants weight was missing from the data set not collected in the data set. No information was given if participants chose not to input information or the information was lost.\n",
    "\n",
    "\n",
    "\n",
    "\n"
   ]
