    "ggplot(data=sleepdata,aes(x=TotalMinutesAsleep, y=TotalTimeInBed)) +\n",
    "  geom_point() +\n",
    "  ggtitle(\"Figure 5: Total Minutes Asleep vs Total Time in Bed\" ) +\n",
    "  theme(plot.title = element_text(hjust = 0.5))+\n",
    "   geom_smooth(method='lm')"
   ]
