    "# Act\n",
    "\n",
    "Bellabeat has many amazing products that are used to empower women by providing data on their daily activity, sleep, stress, hydration and reproductive health. Analyzing how FitBit customers use their app and watch features, recommendations can be made to promote further growth for Bellabeat.\n",
    "\n",
    "For the marketing strategy, we will focus on transforming the Bellabeat app. Rather than simply providing data on user's health, the app should further encourage users to meet fitness their daily fitness goals and establish a strong social media presence \n",
    "\n",
    "\n"
   ]
