   "source": [
    "# Recommendations\n",
    "\n",
    "Bellabeat's products are more like a piece of smart jewellery than a\n",
    " is a typical smart device. \n",
    "\n",
    "* Target Sednedary consumers:  We can position the importance of walking more and completing daily step goals to consumers. Notifications alert on Bellabeat apps will be a benefit for the sedentary to move more. \n",
    "\n",
    "* Encourage users to complete daily steps of 8000 - 10,000  and alert users to complete daily goals.\n",
    "\n",
    "* Encourage women's community events for fitness challenges and alert users to join.\n",
    "\n",
    "* Offer badges and awards to increase the loyalty and social dependency of the Bellabeat App. \n",
    "\n",
    "* Application reminds users to sleep at least 7 hours and enables an alert notification to encourage users to sleep.\n",
    "\n",
    "\n",
    "Other Recommendations\n",
    "\n",
    "*  Encourage users to post favourite workouts, wellness tips and healthy meals on social media platforms.\n",
    "\n",
    "* Encourage users to post how they accessorize their Bellabeat jewelry to encourage community engagement activities. \n",
    "\n",
    "*  Encourage users to enter their monthly weight info to accurately track users BMI \n",
    "\n",
    "Products \n",
    "\n",
    "* Bellabeat Leaf - Emphasis Bellabeat's battery life compared to competitors \n",
    "\n",
    "One of the most appealing features of the Leaf is that it requires no charging. The battery lasts up to 6 months and is easy to replace with a standard CR2032 battery. This means that you never have to worry about charging, and a quick replacement (with the included screwdriver) is super simple.\n"
   ]
